import React from "react";
import { Field, ErrorMessage } from "formik";
import TextError from "../../TextError";
import { Box, Checkbox, FormControlLabel, FormGroup, Paper } from "@material-ui/core";
import { useStyles } from "../../../hooks/Styles";

function CheckboxGroup(props) {
  const { label, name, options, control } = props;
  const classes = useStyles();

  return (
    <Box className={classes.containercheckbox}>
      <label>{label}</label>

      {options.map((option) => {
        return (
          <Box>
            <Field type="checkbox" name="TypeLenseigne" value={option.value} />
            <label>{option.value}</label>
          </Box>
        );
      })}
      <ErrorMessage component={TextError} name={name} />
    </Box>
  );
}

export default CheckboxGroup;
